import React, { useState } from "react";
import "bootstrap/dist/css/bootstrap.css";

import { Nav, Navbar, Container } from "react-bootstrap";

function Navigation() {
  return (
    <div
      style={{
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        backgroundColor: "#b39cd0",
        fontFamily: "Zen Tokyo Zoo",
      }}
    >
      <Navbar>
        <Container>
          <Nav className="fs-2" style={{ gap: "10px" }}>
            <Nav.Link href="#home" style={{ color: "#fff" }}>
              Home
            </Nav.Link>
            <Nav.Link href="#about" style={{ color: "#fff" }}>
              About
            </Nav.Link>
            <Nav.Link href="#contact" style={{ color: "#fff" }}>
              Contact
            </Nav.Link>
            <Nav.Link style={{ color: "#fff" }}>Sign In</Nav.Link>
          </Nav>
        </Container>
      </Navbar>
    </div>
  );
}

export default Navigation;
